    s = input().strip()
    a = float(input())
    b = float(input())
    if a > 10:
        a /= 10
    if b > 10:
        b /= 10
    tb = (a+b)/2
    tt = ""
    if d < 10:
        tt = "TS0" + str(d) 
    else:
        tt = "TS" + str(d)
    kq = ""
    key = 0
    if tb < 5:
        kq = "TRUOT"
        key = 4
    elif 5 <= tb < 8:
        kq = "CAN NHAC"
        key = 3
    elif 8 <= tb < 9.5:
        kq = "DAT"
        key = 2
    else:
        kq = "XUAT SAC"
        key = 1
